import React from "react";
import '../Components/About.css'
import { ReactComponent as WorkIcon } from "../Images/work.svg";
import { ReactComponent as SchoolIcon } from "../Images/school.svg";
import AWSLogo from "../Images/AWS.png";
import CSSLogo from "../Images/CSS.png";
import HTMLLogo from "../Images/HTML.png";
import JavaLogo from "../Images/Java.png";
import JavaScriptLogo from "../Images/JavaScript.png";
import PythonLogo from "../Images/Python.png";
import ReactLogo from "../Images/React.png";


import TimelineElements from "../Components/TimelineElements";

import {
  VerticalTimeline,
  VerticalTimelineElement,
} from "react-vertical-timeline-component";

import "react-vertical-timeline-component/style.min.css";

export default function About() {
  let workIconStyles = { background: "cyan" };
  let schoolIconStyles = { background: "cyan" };

  return (
    <div className="about-me">
        <div>
            <h1 className="title">My Experience</h1>
            <VerticalTimeline >
                {TimelineElements.map((element) => {
                let isWorkIcon = element.icon === "work";

                return (
                    <VerticalTimelineElement
                        key={element.key}
                        date={element.date}
                        dateClassName="date"
                        iconStyle={isWorkIcon ? workIconStyles : schoolIconStyles}
                        icon={isWorkIcon ? <WorkIcon /> : <SchoolIcon />}
                        >
                        <h3 className="vertical-timeline-element-title">
                            {element.title}
                        </h3>
                        <h5 className="vertical-timeline-element-subtitle">
                            {element.location}
                        </h5>
                        <p id="description">{element.description}</p>
                    </VerticalTimelineElement>
                );
            })}
            </VerticalTimeline>
        </div>

        <div>
            <h1 className="skills-title">My Skills</h1>
            <div className="skills">
                <div className="skills-container">
                    <h1 className="skills-header">Frontend</h1>
                    <ul>
                        <li className="list-text"><img src={JavaScriptLogo} className="skills-logo"/>JavaScript</li>
                        <li className="list-text"><img src={ReactLogo} className="skills-logo"/>React</li>
                        <li className="list-text"><img src={CSSLogo} className="skills-logo"/>CSS</li>
                        <li className="list-text"><img src={HTMLLogo} className="skills-logo"/>HTML</li>
                    </ul>
                </div>
                <div className="skills-container">
                    <h1 className="skills-header">Backend</h1>
                    <ul>
                        <li className="list-text">Java</li>
                        <li className="list-text">Python</li>
                        <li className="list-text">Terraform</li>
                        <li className="list-text">AWS</li>
                    </ul>
                </div>
            </div>
        </div>
    </div>
  );
}
